import React from "react";
import "./MidSection.css";

export default function MIdSection() {
  return (
    <div className="wrapper">
      <div className="left-section">
        <div className="desc"></div>
      </div>
      <div className="right-section">
        <img src="Assets/rrrrr.png" />
      </div>
    </div>
  );
}
